import { useEffect,useState,lazy, Suspense} from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { Routes, Route } from "react-router-dom";
import { ThemeContext, themes } from "../context/themeContext";

import AppBar from 'components/AppBar';
import PrivateRoute from 'components/UserMenu/PrivateRoute';
import PublicRoute from 'components/UserMenu/PublicRoute';
import LanguageSwitcher from 'components/LanguageSwitcher/LanguageSwitcher';
import Loader from '../common/Loader';
import HomePage  from 'pages/HomePage';

import { loadingSelector } from '../../redux/phoneBook/phonebook-selectors';
import { authSelectors, authOperations } from '../../redux/auth';

import s from './App.module.css';
import ThemeSwitcher from 'components/ThemeSwitcher/ThemeSwitcher';

const SingInPageLazy = lazy(() => import('../../pages/auth/SingInPage'));
const RegisterLazy = lazy(() => import('../../pages/auth/Register'));
const ContactsPageLazy = lazy(() => import('../../pages/ContactsPage'));
const ClockPageLazy = lazy(() => import('../../pages/ClockPage/ClockPage'));
const NotFoundPageLazy = lazy(() => import('../../pages/NotFoundPage'));



const App = () => {

  const [theme, setTheme] = useState(themes.light);

  const toggleTheme = () =>
    setTheme((prevTheme) =>
      prevTheme === themes.light ? themes.dark : themes.light
    );

  const loading = useSelector(loadingSelector);
  const fetchloading = useSelector(authSelectors.loadingFetchSelector);

  const dispatch = useDispatch();
  let time = new Date().getHours();


  //GET_CURRENT_USER

  useEffect(() => {

    dispatch(authOperations.fetchUser())  

  }, [dispatch])

  return (
    <div className={theme === themes.light && time <= 12 ? s.appLight : s.appDark}>

      <ThemeContext.Provider value={{ theme, toggleTheme }}>

{loading && <Loader loading={loading} />}

      {!fetchloading &&
        <>
          <AppBar />
          <div className={s.themeWrap}>

            <Suspense fallback={<Loader />}>
              <LanguageSwitcher />
            </Suspense>
             <ThemeSwitcher />
          </div>


          <Routes>

            <Route
              exact
              path="/"
            element={
              <Suspense fallback={<Loader />}>
                <HomePage />
              </Suspense>}>
            </Route>
            {/* //////////////////////// */}
            <Route element={
              <PublicRoute />}>

              <Route
                exact
                path="/register"
                element={
                  <Suspense fallback={<Loader />}>
                    <RegisterLazy />
                  </Suspense>}
              />

              <Route
                exact
                path="/sing_in"
                element={
                  <Suspense fallback={<Loader />}>
                    <SingInPageLazy />
                  </Suspense>}
            />
              <Route
                path="*"
                element={
                  <Suspense fallback={<Loader/>}>
                    <NotFoundPageLazy />
                  </Suspense>
                }
              />
          </Route>



            {/* //////////////////////// */}
            <Route element={<PrivateRoute />}>
              <Route
                path="/phonebook"
                element={
                  <Suspense fallback={<Loader />}>
                    <ContactsPageLazy />
                  </Suspense>}
              />
              <Route
                path="/clock"
                element={
                  <Suspense fallback={<Loader />}>
                    <ClockPageLazy/>
                  </Suspense>}
              />
            </Route>

          </Routes>
          </>}
        </ThemeContext.Provider>
  </div>
  );
};

export default App;
